    public class Requests
    {
        public static bool File_Upload(string Fielname,string orcdata,bool orcisright, string Name,string IDCardNo,string houseid)
        {
            try
            {
                string url = Global.Config.UploadUrl;
                Dictionary<string, object> dic = new Dictionary<string, object>
                {
                    {"id",Global.UUID },
                    {"ipaddress", Global.IP},
                    {"macaddress", Global.MAC},
                    {"marchineid",Global.Config.MachineCode},//设备代号
                    {"orcdata",orcdata },
                    {"uptime",DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss") },
                    {"username",Name },
                    {"orcisright",orcisright.ToString() },
                    {"idcard",IDCardNo },
                    {"houseid",houseid }

                };

                url = DicAndUrl(url, dic);
                Log.WriteUrl(url,null);


                string path = Fielname;
                HttpWebRequest request = WebRequest.Create(url) as HttpWebRequest;
                CookieContainer cookieContainer = new CookieContainer();
                request.CookieContainer = cookieContainer;
                request.AllowAutoRedirect = true;
                request.Method = "POST";
                string boundary = DateTime.Now.Ticks.ToString("X"); // 随机分隔线
                request.ContentType = "multipart/form-data;charset=utf-8;boundary=" + boundary;
                byte[] itemBoundaryBytes = Encoding.UTF8.GetBytes("\r\n--" + boundary + "\r\n");
                byte[] endBoundaryBytes = Encoding.UTF8.GetBytes("\r\n--" + boundary + "--\r\n");
                int pos = path.LastIndexOf("\\");
                string fileName = path.Substring(pos + 1);

                //请求头部信息
                StringBuilder sbHeader = new StringBuilder(string.Format("Content-Disposition:form-data;name=\"file\";filename=\"{0}\"\r\nContent-Type:application/octet-stream\r\n\r\n", fileName));
                byte[] postHeaderBytes = Encoding.UTF8.GetBytes(sbHeader.ToString());

                FileStream fs = new FileStream(path, FileMode.Open, FileAccess.Read);
                byte[] bArr = new byte[fs.Length];
                fs.Read(bArr, 0, bArr.Length);
                fs.Close();

                Stream postStream = request.GetRequestStream();
                postStream.Write(itemBoundaryBytes, 0, itemBoundaryBytes.Length);
                postStream.Write(postHeaderBytes, 0, postHeaderBytes.Length);
                postStream.Write(bArr, 0, bArr.Length);
                postStream.Write(endBoundaryBytes, 0, endBoundaryBytes.Length);
                postStream.Close();

                HttpWebResponse response = request.GetResponse() as HttpWebResponse;
                Stream instream = response.GetResponseStream();
                StreamReader sr = new StreamReader(instream, Encoding.UTF8);
                string content = sr.ReadToEnd();
                Log.WriteUrl(url, content);
                return true;
            }
            catch
            {
                return false;
            }
        }

